var jlength = jetGeojson.features.length;

var map = L.map ('map', {
		center: [41.80989, -108.99809],
		zoom: 9,
		minZoom: 6,
		maxZoom: 16
	});

L.tileLayer('http://tile.stamen.com/terrain/{z}/{x}/{y}.jpg', {
	attribution: "Map tiles by <a href='http://maps.stamen.com/' target=_blank>Stamen</a>.",
}).addTo(map);

var markerIcon = new L.icon({
		iconUrl: 'images/flag.png',
		popupAnchor: [0, 0],
		iconSize: [30,30]
	});

var endCoord = [Number(jetGeojson.features[jlength-1].geometry.coordinates[1]), Number(jetGeojson.features[jlength-1].geometry.coordinates[0]), 'End point'];
var startCoord = [Number(jetGeojson.features[0].geometry.coordinates[1]), Number(jetGeojson.features[0].geometry.coordinates[0]), 'Start point'];

var endMarker = L.marker([endCoord[0],endCoord[1]],{icon: markerIcon});
var startMarker = L.marker([startCoord[0],startCoord[1]],{icon: markerIcon});

endMarker.addTo(map);
startMarker.addTo(map);

endMarker.bindPopup("Migration ends.", {autoPan: false, offset: (5,5)}).openPopup();
startMarker.bindPopup("Migration begins.", {autoPan: false, offset: (5,5)}).openPopup();


var lineStyle = {
        color: '#C24E13',
		clickable: false,
		weight: 3,
        opacity: 0.8,
		lineJoin: 'round',
    };
	
	
var polyline = L.polyline([], lineStyle).addTo(map);
var i = 0;
var x = 0;
var t = 500;

sequenceInteractions();

function add(j) {
	j = jetGeojson;
	var lat = Number(j.features[i].geometry.coordinates[0]);
	var lng = Number(j.features[i].geometry.coordinates[1]);
	
    polyline.addLatLng(
        L.latLng(
            lng,
            lat));
			
	map.setView([lng, lat], 11);
	
	document.getElementById('date').innerHTML = j.features[i].properties.Dates;
	document.getElementById('time').innerHTML = j.features[i].properties.Time;
	document.getElementById('xy').innerHTML = j.features[i].geometry.coordinates;
	document.getElementById('range').innerHTML = j.features[i].properties.Attribute;
	// document.getElementById('id').innerHTML = i;
	// document.getElementById('x').innerHTML = x;

    if (++i > x) window.setTimeout(add, t);
}

function play(){
	
	j = jetGeojson;
	var jlength = j.features.length;
	
	if (x == -1 && i == 0){
		t = 500;
		polyline = L.polyline([], lineStyle).addTo(map);
		add();
	} else if (x == jlength && i == jlength){
		map.removeLayer(polyline);
		x = 0;
		i = 1;
		t = 500;
		polyline = L.polyline([], lineStyle).addTo(map);
		add();
	} else {
		x = i-2;
		t = 500;
		add();
	};
	
};

function pause(){
	x = i+1;
};

function start(){
	map.removeLayer(polyline);
	x = -1;
	i = 0;
	play();
};

function end(j){
	map.removeLayer(polyline);
	
	j = jetGeojson;
	jlength = j.features.length;
	polyline = L.polyline([], lineStyle).addTo(map);
	
	
	for (var r = 0; r < jlength; ++r) {
		var lat = Number(j.features[r].geometry.coordinates[0]);
		console.log(lat);
		var lng = Number(j.features[r].geometry.coordinates[1]);
		console.log(lng);
		polyline.addLatLng(
			L.latLng(
				lng,
				lat));
		map.setView([j.features[jlength - 1].geometry.coordinates[1], j.features[jlength - 1].geometry.coordinates[0]], 11);
	    };
		
	x = jlength;
	i = jlength;
	console.log(x);
	console.log(i);
};


function fullroute(j){
	map.removeLayer(polyline);
	
	j = jetGeojson;
	jlength = j.features.length;
	polyline = L.polyline([], lineStyle).addTo(map);
	
	for (var r = 0; r < jlength; ++r) {
		var lat = Number(j.features[r].geometry.coordinates[0]);
		console.log(lat);
		var lng = Number(j.features[r].geometry.coordinates[1]);
		console.log(lng);
		polyline.addLatLng(
			L.latLng(
				lng,
				lat));
		map.setView([j.features[(jlength*2)/3].geometry.coordinates[1], j.features[(jlength*2)/3].geometry.coordinates[0]], 8);
	    };
		
	x = jlength;
	i = jlength;
	console.log(x);
	console.log(i);
};


function sequenceInteractions() {
    $(".pause").hide();
    
    $(".play").click(function() {
        $(".pause").show();
        $(".play").hide();
        play();
    });
    
    $(".pause").click(function() {
        $(".pause").hide();
        $(".play").show();
       pause();
    });
	
	$(".step-full").click(function() {
		$(".pause").hide();
        $(".play").show();
        end(); 
    });
	
	$(".back-full").click(function() {
		$(".pause").show();
        $(".play").hide();
		start(); 
    });
	
	$(".full-route").click(function() {
		$(".pause").hide();
        $(".play").show();
        fullroute(); 
    });
	
};

